    <div className='bestSellers-dropdown-eachDirectory'>


        <img className='bestSellers-dropdown-img' src={imageUrl} alt='' />
        <div>
            <p className='bestSellers-dropdown-title'>{title}</p>
        </div>


    </div>
);

export default DirectoyHoverDropdown;
